import { GoogleLogin ,googleLogout } from '@react-oauth/google';
import react, { useState } from "react";
import { GoogleOAuthProvider } from '@react-oauth/google';



export default function Logon() {
        const [showLogin, setShowLogin] = useState(false);
        // const [showLogout, setShowLogout] = useState(false);
    
        const responseSucess = () => {
        setShowLogin(true);
    // setShowLogout(true);
    };

    const responseFailure = () => {
    console.log("login is not sucesss");
    };

    const Logout = () => {
    setShowLogin(true);
    };
    <GoogleOAuthProvider clientId="500804855419-pms6km4isevbtq88rpgbpp02tdjq26fm.apps.googleusercontent.com">...</GoogleOAuthProvider>;
    return (
    <div className="App">
        {!showLogin && (
        <GoogleLogin
            clientId="1077364798261-pj7j8ru37l6ih0qt0pstuj8v21au8mag.apps.googleusercontent.com"
            buttonText="Login"
            onSuccess={responseSucess}
            onFailure={responseFailure}
        />
        )}
        {showLogin && (
        <googleLogout
            buttonText="Logout"
            onLogoutSuccess={Logout}
        ></googleLogout>
        )}
    </div>
    );
}
